import React from 'react';
import { Outlet, L } from 'react-router-dom';


const Layout = () => {
    return (
        <React.Fragment>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/blogs">Blogs</Link>
                    </li>
                    <li>
                        <Link to="/contact">Contact</Link>
                    </li>
                </ul>
            </nav>

            <outlate />
        </React.Fragment>
    );
}

export default Layout;
